import pandas as pd
import collections
import numpy as np

def transform_data(df1):
    # Calculate average unemployment rate by month and series (industry)
    transformed_df = df1.groupby(['series', 'month'], as_index=False).agg({
        'rate': 'mean'
    }).rename(columns={'rate': 'avg_rate'})

    # Add month name for better readability
    month_names = {
        1: 'Jan', 2: 'Feb', 3: 'Mar', 4: 'Apr', 5: 'May', 6: 'Jun',
        7: 'Jul', 8: 'Aug', 9: 'Sep', 10: 'Oct', 11: 'Nov', 12: 'Dec'
    }
    transformed_df['month_name'] = transformed_df['month'].map(month_names)

    return transformed_df
